import React from "react";
import Slider from "react-slick";
import "../style.css";
import AHDtheaterImg1 from '../image/AHDtheater-1.png';
import AHDtheaterImg2 from '../image/AHDtheater-2.png';
import AHDtheaterImg3 from '../image/AHDtheater-3.png';
import AHDtheaterImg4 from '../image/AHDtheater-4.png';
export default function TheaterDetail() {
  var settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
  };
  return (
    <Slider {...settings}>
      <div>
        <img 
            src={AHDtheaterImg1} // Sử dụng đường dẫn của ảnh
            alt="AHD Theater" // Văn bản mô tả cho ảnh
            // style={{ width: '800px', height: '300' }} // Thiết lập kích thước cho ảnh
            className="slider-img"
            />
      </div>
      <div>
        <img 
            src={AHDtheaterImg2} // Sử dụng đường dẫn của ảnh
            alt="AHD Theater" // Văn bản mô tả cho ảnh
            // style={{ width: '800px', height: '300' }} // Thiết lập kích thước cho ảnh
            className="slider-img"
            />
      </div>
      <div>
        <img 
            src={AHDtheaterImg3} // Sử dụng đường dẫn của ảnh
            alt="AHD Theater" // Văn bản mô tả cho ảnh
            // style={{ width: '800px', height: '300' }} // Thiết lập kích thước cho ảnh
            className="slider-img"
            />
      </div>
      <div>
        <img 
            src={AHDtheaterImg4} // Sử dụng đường dẫn của ảnh
            alt="AHD Theater" // Văn bản mô tả cho ảnh
            // style={{ width: '800px', height: '300' }} // Thiết lập kích thước cho ảnh
            className="slider-img"
            />
      </div>
    </Slider>
  );
}
